マジカルカーボン シフトパネル<br><br>

ハスラーMR31S全車のAT仕様に装着可能なシフトレバー周りに貼るマジカルカーボン製シールです。<br>
色の選択によって、レーシーにも豪華にも演出可能!!<br>
装着写真のブラック以外にも、シルバー、ゴールド、ガンメタ、レッド、ピンク、ブルー、イエローが同価格でございます。<br>
ご注文後にメーカーから取り寄せる商品です。<br>
ご注文時に必要な色をお選びください。
<br>
この商品は（株）ハセ・プロの特許製品です。<br>
（株）ハセ・プロと共同開発を行っております。<br>
<br>
【ご注意】<br>
※メーカーからの直送商品です。納期２～３日かかります。<br>
※別商品との同梱はできません。<br>
※代引きはお受けすることが出来ません。<br>
※お急ぎの方はご注文前に納期お問い合わせ下さい。<br>
※送料無料ですが、北海道・沖縄・離島の場合は送料別途かかりますので、送料見積させていただきます。<br>







